import TweetEmbed from 'react-tweet-embed'


function App() {
  const tweets = [
    "1549673116686864384",
    "1549514986644545536",
    "1549683893309059073",
    "1549635215546429441",
    "692527862369357824"
  ]
  return (
    <div className="App">
      {tweets.map((tweet) => <TweetEmbed tweetId={tweet} />)}
    </div>
  );
}

export default App;
